import "./App.css";
import {
    BrowserRouter as Router,
    Route,
    Link
} from "react-router-dom";

function App() {
  return (
      <Router>
        <Route exact={true} path="/" render={() => (<h1>hello</h1>)} />
        <Route path="/org" render={() => (<h1>org</h1>)} />
        <Route path="/" render={() => (<h1>Not found!</h1>)} />
      </Router>
  );
}

export default App;
